import styled from 'styled-components';

import { Background, Primary } from './Colors.js'

export default styled.div`
	position: ${props => (props.top ? 'fixed' : 'relative')};
	top: 0;
	width: 100%;
	height: ${props => (props.top ? '50px' : 'auto')};
	padding: 0px 5rem 0px 1rem;
	border-color: ${Primary};
	border-style: solid;
	border: ${props => (props.top ? '0px 0px 1px 0px' : '0px')};


	background-color: ${Background};
`;
